import './App.css';
import NewsRenderDemo from "./components/NewsRenderDemo";

function App() {
  return (
    <Provider store={store}>
    <Routes >

    <Route path="/redux2" element={<ReduxDemo />} />
   <Route path="/news" element={<NewsRenderDemo />} />
    </Routes >
    </Provider>



  );
};
function Home() {
  return (
    <NavBar />
    )
  }
export default App;
